import './index.css';

function Game2(){
    return(
        <Board />
    );
}

function Board(){
    return(
        <>
            {Array(3).fill(null).map((x) => <OneRow key={x} />)}
        </>
    );
}

function OneRow(){
    return(
        <div className='game-board'>
            {Array(3).fill(null).map((index) => <Square key={index}/>) }
        </div>
    );
}

function Square(){
    return(
        <div className='square'>
            X
        </div>
    );
}
export default Game2;
